import React, { useState } from 'react';
import './BookingForm.css';

const BookingForm = ({ selectedRoute, selectedBus, selectedSeats, onComplete }) => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        phone: '',
        idNumber: ''
    });

    const handleSubmit = (e) => {
        e.preventDefault();

        if (!formData.name || !formData.email || !formData.phone) {
            alert('Please fill in all required fields');
            return;
        }

        // Call onComplete instead of onSubmit
        onComplete(formData);
    };

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const totalAmount = selectedSeats.length * 150;

    return (
        <div className="booking-form-container">
            <div className="booking-header">
                <h2>Complete Your Booking</h2>
                <p>Please provide your details to continue</p>
            </div>

            <div className="booking-summary-card">
                <h3>ðŸ“‹ Booking Summary</h3>
                <div className="summary-details">
                    <div className="summary-row">
                        <span className="label">Route:</span>
                        <span className="value">{selectedRoute.startLocation} â†’ {selectedRoute.destination}</span>
                    </div>
                    <div className="summary-row">
                        <span className="label">Bus:</span>
                        <span className="value">{selectedBus.busNumber}</span>
                    </div>
                    <div className="summary-row">
                        <span className="label">Departure:</span>
                        <span className="value">{selectedBus.departureTime}</span>
                    </div>
                    <div className="summary-row">
                        <span className="label">Selected Seats:</span>
                        <span className="value seats-display">{selectedSeats.join(', ')}</span>
                    </div>
                    <div className="summary-row total">
                        <span className="label">Total Amount:</span>
                        <span className="value price">K{totalAmount}</span>
                    </div>
                </div>
            </div>

            <form onSubmit={handleSubmit} className="passenger-form">
                <h3>ðŸ‘¤ Passenger Information</h3>

                <div className="form-group">
                    <label htmlFor="name">Full Name *</label>
                    <input
                        type="text"
                        id="name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        placeholder="Enter your full name"
                        required
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="email">Email Address *</label>
                    <input
                        type="email"
                        id="email"
                        name="email"
                        value={formData.email}
                        onChange={handleChange}
                        placeholder="your.email@example.com"
                        required
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="phone">Phone Number *</label>
                    <input
                        type="tel"
                        id="phone"
                        name="phone"
                        value={formData.phone}
                        onChange={handleChange}
                        placeholder="0977123456"
                        required
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="idNumber">NRC/Passport Number (Optional)</label>
                    <input
                        type="text"
                        id="idNumber"
                        name="idNumber"
                        value={formData.idNumber}
                        onChange={handleChange}
                        placeholder="Enter your ID number"
                    />
                </div>

                <div className="form-actions">
                    <button type="submit" className="btn btn-primary btn-large">
                        Proceed to Payment â†’
                    </button>
                </div>

                <p className="form-note">
                    * Required fields. Your booking confirmation will be sent to your email.
                </p>
            </form>
        </div>
    );
};

export default BookingForm;
